I bemoaned my frustration and my loving daughter replied “well you do tend to fall for unavailable men, mum”, my reply “here is the thing bub they are available just not to me”.

Years of therapy kicked in at this point and I said “here is the thing though, I am the common denominator, so it is something I am doing”!

I don’t believe in coincidence and maybe it was my iPhone listening to my conversation but I was suggested this wonderful video on YouTube by @jayshetty 

When they speak on chemistry WOW huge AHA moment. 

I had said to my daughter, what is my pattern, how can I check these guys at the door!

Recognising compatibility vs chemistry is so on point! 

I dated a guy in Sagittarius season and it was the first date in my life I felt actual compatibility, we talked, we laughed, we shared. Found common ground... When this connection did not pan out how I would of hoped I also let it go which confused me as I usually hang on and twist myself into knots diving ever so deeper into my trauma, here I didn’t, I wished him well in my heart and mind and feel no need to try engage him further. 

The chemistry people we get SUPER twisted on!

We are taught, is there chemistry the twin flame delusion of someone feeling familiar is a sign of a twin flame! If it feels familiar it is karmic, we are dancing a familiar dance...

Chemistry is easy we all know that the true friends we have those “compatible” to us are few...

How can I change this? I can’t stop others engaging in chemistry dialogue with me but I can reduce noise in my life by looking for compatibility and let chemistry follow.

This video is also a wonderful deep dive into what going into therapy really is, what the work is and how it can change us.
 A wonderful explanation of how we can learn to witness others, be accountable to our patterns and choices and be present as “happiness is a symptom of, not the goal”.

