.
Dig deeper...what is the rawest part of letting go? Is there a symbolic meaning? Is it you feel you have lost your empowerment, freedom, independence, courage, or discipline? Does the pain hurt because you think that it's all gone? Can you find the parallel, in that it stands for, what will always remain inside you, with or without that tangible piece you held dearly to? This temporary disconnection, will be back. You can come back stronger than ever before! Get back to the simplicity of you.
.
CRESCENT MOON
.
The crescent moon is a dusty ball of rock, home to mountains, craters and reflects light from the Sun. The moon itself doesn't actually produce it's own light. This shape represents the lunar phase. There is a shadow on a crescent moon, but it's the moon's own shadow. 
.
Earthshine is where you may actually see a pale glow, on the full portion of the moon, when the moon is a crescent. The temperatures can get as low as -153°C.
.
When the crescent moon shines brightly, there is no difference in it's overall compelling nature, to the full moon. 
.
